import AppHeader from "../appHeader/AppHeader";

function App() {
    return (
        <div className="app">
            <AppHeader />
            <main>
                <randomChar />
                <div className="char__content">
                    <CharList />
                    <CharInfo />
                </div>
                <img className="bg-decoration" src={decoration} alt="vision"></img>
            </main>
        </div>
    );
}

export default App;
